import axios from 'axios';

const EMPLOYEE_API_BASE_URL="http://localhost:8087/api/admin/travelplans";

class AdminService{

    getAllPlans(){
        return axios.get(EMPLOYEE_API_BASE_URL);
    }
    createPlan(travelPlan){
        return axios.post(EMPLOYEE_API_BASE_URL,travelPlan)
    }
    getPlanById(travelPlanId){
         return axios.get(EMPLOYEE_API_BASE_URL+'/'+travelPlanId)
    }
    updatePlan(travelPlan,travelPlanId){
        return axios.put(EMPLOYEE_API_BASE_URL+'/'+travelPlanId,travelPlan)
    }
    deletePlan(travelPlanId){
        return axios.delete(EMPLOYEE_API_BASE_URL+'/'+travelPlanId)
    }
}
